import React, { useState } from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faFacebook, faTwitter, faInstagram } from '@fortawesome/free-brands-svg-icons';
import './Footer.css';

const Footer = () => {
    const [showReturnPolicy, setShowReturnPolicy] = useState(false);

    const handleReturnClick = () => {
        setShowReturnPolicy(true);
    };

    return (
        <footer>
            <div className="footer-section">
                <h3>About Us</h3>
                <p>Welcome to ClasherStation, your one-stop destination for the ultimate gaming experience. We offer a wide range of high-quality gaming consoles, games, and accessories. Our mission is to provide gamers with the best products, exclusive collections, and top-notch customer service. Trusted by gamers worldwide, ClasherStation is committed to delivering excellence in every aspect of your gaming journey.</p>
            </div>
            <div className="footer-section">
                <h3>Customer Service</h3>
                <ul>
                    <li><a href="#" onClick={handleReturnClick}>Returns</a></li>
                    <li><a href="/faqs">FAQs</a></li>
                    <li><a href="#">Shipping</a></li>
                </ul>
                {showReturnPolicy && (
                    <div className="return-policy">
                        <h4>Return Procedures</h4>
                        <p>If you need to return a product, please follow these steps:</p>
                        <ol>
                            <li>Contact our customer service team at <a href="mailto:support@clasherstation.com">support@clasherstation.com</a> or call us at +91 9608632246 to initiate the return process.</li>
                            <li>Provide your order number and the reason for the return.</li>
                            <li>Our team will provide you with a Return Merchandise Authorization (RMA) number and further instructions.</li>
                            <li>Pack the item securely in its original packaging, including all accessories, manuals, and documentation.</li>
                            <li>Write the RMA number on the outside of the package.</li>
                            <li>Ship the return package to the address provided by our customer service team.</li>
                            <li>Once we receive and inspect the item, we will process your refund or exchange within 5-7 business days.</li>
                        </ol>
                    </div>
                )}
            </div>
            <div className="footer-section">
                <h3>Follow Us</h3>
                <ul className="social-media">
                    <li><a href="https://www.facebook.com" target="_blank" rel="noopener noreferrer"><FontAwesomeIcon icon={faFacebook} /> Facebook</a></li>
                    <li><a href="https://www.twitter.com" target="_blank" rel="noopener noreferrer"><FontAwesomeIcon icon={faTwitter} /> Twitter</a></li>
                    <li><a href="https://www.instagram.com" target="_blank" rel="noopener noreferrer"><FontAwesomeIcon icon={faInstagram} /> Instagram</a></li>
                </ul>
            </div>
            <div className="footer-section">
                <h3>Newsletter</h3>
                <input type="email" placeholder="Your email address" />
                <button>Subscribe</button>
            </div>
        </footer>
    );
};

export default Footer;
